import Layout from "../components/Layout";
import Slider from '../components/Slider'

const Index = () => {
  return (
    <Layout>
      <div className="container" id="s" style={{ maxWidth: '100%', height:'auto' }}>
        <h2 className="text-center">Home Page</h2>
        <Slider/>
      </div>
    </Layout>
  );
};

export default Index;
